function Cardie (props){
    return(


            <>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </>
    )
}

const Footer = () => {
    return (
        <div>
        <Container>
        <Row style={{color: 'white', background: "#111111" , position: "absolute", paddingTop: "100pt", paddingBottom: "100pt", left:"0" , right:"0"}}>
            <Col>    
                <Cardie name="Products" para="On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment"/>
            </Col>      
            <Col> 
                <Cardie name="About" /> 
            </Col>
            <Col>    
                <Cardie name= "Contact"/>  
            </Col>
        </Row>
        </Container>
        </div>
     );
}

export default Footer;
